import Navigation from './components/navigation/navigation.component';
import { Routes, Route } from 'react-router-dom';

function App() {
  return (
    <div className="App">
    <Routes>
      <Route path="/" element={<Navigation />}>

      </Route>
    </Routes>

    </div>
  );
}

export default App;
